Perfect Digital Photography

In this completely updated, full-colour work, a Pulitzer Prize-winning National Geographic photographer and an Adobe Photoshop Certified Expert guide you through the entire photographic process, from composition to printing and archiving.

The expert techniques inside this masterful guide help you greatly improve both the quality of your photographs and your proficiency in the digital darkroom. Perfect Digital Photography, Second Edition covers the latest technologies, including digital SLR cameras, Adobe Photoshop CS4, and Adobe Photoshop Lightroom, and offers tips for developing an efficient workflow. Stunning colour photographs throughout the book show you the results that you too can achieve.

